import * as api from '../api/index.js';

export const register = (sellerInfo,router) =>  async(dispatch) => {
    try {
       const result = await api.registerSeller(sellerInfo)
       dispatch({type: 'REGISTER', payload: result.data.result}); 

        //router.push('/customer');
    } catch (error) {
        console.log(error);
    }
};
